import React,{Component} from "react";
import Login from './signIn'
import Signup from './signUp' 
import './signInUpContainer.css'

class SignInOutContainer extends Component{
    constructor(props){
        super(props);
        this.state={
            page:"signIn"
        }


        this.chnagePage = this.chnagePage.bind(this);
    }
    chnagePage=()=>{
        if(this.state.page==="signIn"){
            this.setState(this.state.page="signUp")
        }
        else{
            this.setState(this.state.page="signIp") 
        }
    }
    render(){
        return(
            <React.Fragment>
                <div class="tab">
  <button class="tablinks" onclick={this.chnagePage}>London</button>
  <button class="tablinks" onclick="openCity(event, 'Paris')">Paris</button>
  
</div>
            </React.Fragment>

        )}
};

export default SignInOutContainer;
